import React from "react";
import { Link } from "react-router-dom";
import styled from "styled-components";
export default function BlogCard(params) {
  return (
    <>
      <BlogCardContainer>
        <BlogWrapper>
          <NavLink>
            <img
              src="https://ghost.org/blog/content/images/size/w1000/2021/07/publishing-metrics--1-.png"
              alt="img"
              width="100%"
              height="100%"
            />
          </NavLink>
          <BlogContent>
            <h2>How to increase the open rates of your email newsletter</h2>
            <p>
              Writing a great email takes time, creativity, and practice.
              Getting readers to open those emails is no different. Apply these
              tips to ensure your hard work gets read.
            </p>
          </BlogContent>
        </BlogWrapper>
      </BlogCardContainer>
    </>
  );
}
const BlogCardContainer = styled.div`
  padding: 0 20px;
  display: flex;
  flex-direction: column;

  margin-bottom: 30px;
`;
const BlogWrapper = styled.div``;
const BlogContent = styled.div`
  width: 100%;
  max-width: 896px;
  text-align: left;
`;
const NavLink = styled(Link)`
  width: 300px;
  height: 300px;
  display: block;
  img {
    border-radius: 20px;
  }
`;
